import React from 'react'

const Listusers = ({ props }) => {
    return (
      <div>
        {props.map((user, i) => {
          return (
            <ul key={i}>
              <li>
                <p>Nombre:{user.name}</p>
              </li>
            </ul>
          );
        })}
      </div>
    );
  };
export default Listusers
